import React,{useState} from 'react'

export default function Count() {
    const [name, setName]=useState('Sangeeta')
    const changeData=()=>{
        if(name==='Sangeeta'){
            setName('Soumi')
        }
        else{
            setName('Sangeeta')
        }
    }
  return (
    <div>
      <h1>how to create toggle data using useState hooks</h1>
      <h1>{name}</h1>
      <button style={{background:'red',color:'white'}} onClick={changeData}>click me</button>
    </div>
  )
}
